CREATE TABLE `jobs` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `job_number` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `recruiter_id` bigint(20) unsigned NOT NULL,
  `occupation_id` bigint(20) unsigned NOT NULL,
  `country_id` bigint(20) unsigned NOT NULL,
  `recruiter_show_name` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
