  `job_description` text COLLATE utf8mb4_unicode_ci,
  `qualification` text COLLATE utf8mb4_unicode_ci,
  `allowance` text COLLATE utf8mb4_unicode_ci,
  `job_start_date` text COLLATE utf8mb4_unicode_ci,
  `job_location` text COLLATE utf8mb4_unicode_ci,
  `message` text COLLATE utf8mb4_unicode_ci,
  `other_keywords` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `application_address` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `job_post_status` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
