エイティブマネージャー 4.運営プランナー',NULL,'1.マーケティング\n2.プロジェクトマネージャー\n3.クリエイティブマネージャー\n4.運営プランナー\n\nスタッフ数：日本籍3名、外国籍3名','正社員,契約社員/嘱託社員','1.マーケティング\n・市場調査、競合分析やトレンド把握\n・ブランディング戦略の立案、運用のオペレーション業務全般\n・オフラインイベントの調整、企画\n・予算管理、戦略立案から実施、PDCAサイクルの推進\n・海外メンバーと連携し、代理店やメディアとの折衝業務\n\n2.プロジェクトマネージャー\n・ゲーム運営、インゲームイベントの企画立案・運⽤。または制作現場を管理するディレクション業務\n・プロジェクト全体のプランニング、予算管理、目標設定\n・ユーザー属性、イベント効果など各種データ分析（PDCAサイクルの推進）\n・カスタマーチーム・デバッグ対応などエンドユーザーのケア管理\n・海外メンバーと協力会社との連携対応\n・担当タイトルのローカライズ・リリース対応\n\n3.クリエイティブマネージャー\n・各種クリエイティブの企画立案・運⽤。または制作現場のディレクション業務\n・各種データ分析（PDCAサイクルの推進）\n・海外メンバーと協力会社との連携対応\n\n4.運営プランナー\n・海外ゲームのローカライズ・リリース対応\n・各種イベントの企画立案・運⽤、そして効果分析\n・カスタマーサポート・デバッグ対応など\n・海外メンバーと協力会社との連携対応','1.マーケティング 　※20～40代が活躍中\n＜必要条件＞\n・ブランディング、会社PR、屋外広告、オフラインイベントいずれかの経験が2年以上（業界不問）\n・アニメ・ゲームなどの二次元コンテンツをビジネス視点で捉えられる方\n・Microsoft Officeを操作でき、Excelによる高度な関数操作、分析が可能な方\n・スマホアプリ、PCブラウザゲーム、クライアントゲームなどを日常的にプレイしている方\n語学：日本語ビジネスレベル以上\n\n＜次のような方のご応募歓迎です＞\nプロジェクト管理・推進経験がある方\n中国語が話せる方\n他社や海外企業との折衝実務経験がある方\nゲーム業界経験1年以上の方\nブランディング、広告代理店、イベント、2次元コンテンツ業界経験者\n\n\n2.プロジェクトマネージャー ※20～30代が活躍中\n＜必要条件＞\n・リリースから運営、プロジェクト全般の経験（1年以上）\n・パブリッシングチーム管理、運営チーム管理の経験（1年以上\n・オンラインゲーム運営の経験（2年以上、PC・スマホなどのデバイスやジャンルは不問）\n・ユーザー分析、イベント効果分析などの高度な分析能力（PDCAサイクルを⾏った経験もあれば、尚歓迎）  \n・スマホアプリ、PCブラウザゲーム、クライアントゲームなどを日常的にプレイしている方\n・アニメ・ゲームなどの二次元コンテンツをビジネス視点で捉えられる方\n・アドベンチャーやカードに関するゲームアプリジャンルに対する高度な理解\n語学：日本語ビジネスレベル以上\n\n＜次のような方のご応募歓迎です＞\n分野問わず分析実務の経験がある方\n中国語が話せる方\n他社や海外企業との折衝実務経験がある方\nCS、販売、など対人能力が高い方\nコンピューターサイエンスなど、理系出身の方\n\n\n3.クリエイティブマネージャー ※20～30代が活躍中\n＜必要条件＞\n・2年以上After Affects、Premiere、Photoshop、Illustratorなどを使用したデザイン制作の実務経験\n・1年以上事業会社、デザイン事務所、広告代理店クリエイティブ部門でのデザイン実務経験 および ディレクション実務経験\n・高度なデザイン能力とセンス\n・スマホアプリ、PCブラウザゲーム、クライアントゲームなどを日常的にプレイしている方\n・アニメ・ゲームなどの二次元コンテンツが好きな方\n・動画制作や動画のワイヤー案をプランニング、企画可能の方\n語学：日本語ビジネスレベル以上\n\n＜次のような方のご応募歓迎です＞\nMMD、MAD制作経験がある方\n同人活動、制作経験\n絵を手描き、日常的に絵を描く方\n他社や海外企業との折衝実務経験がある方\n分野問わず分析実務の経験がある方\n\n\n4.運営プランナー ※20～30代が活躍中\n＜必要条件＞\n経験：オンラインゲーム運営の経験1年以上（デバイスやジャンルは不問）\nスマホアプリ、PCブラウザゲーム、クライアントゲームなどを日常的にプレイしている方\n語学：日本語日常会話以上\n\n＜次のような方のご応募歓迎で