ラ、brother、富士ゼロックスなど','写真付き履歴書と職務経歴書を下の応募ボタンよりお送りください。書類選考の上、面接に進んでいただきたい方にご連絡差し上げます。\n\n面接回数は2回、オンライン面接、現地面接が可能です。面接は英語/中国語になります。\n1回目：面接担当：営市場部責任者、ベトナム支社総経理、人事総監\n2回目：面接担当：市場部責任者、社長、人事総監','【給与・手当】\nマネージャーレベル：37,500,000～75,000,000VND\n主任レベル：25,500,000～45,000,000VND\nボーナス：年1回（業績による）\nその他：応相談\n\n【福利厚生など】\n海外旅行保険、ビザサポート（日本語ネイティブの方）\n\n【勤務時間・休日】\n勤務時間：9:00～18:00（週6日勤務、8時間制）\n休暇：現地のカレンダー通り\n有給：あり',NULL,'ベトナム ハノイ',NULL,'新卒歓迎,シニア歓迎,未経験歓迎','crzycrzy12@gmail.com','post','2020-11-06 10:25:41',NULL,3,'2020-11-05 19:03:49','2021-01-27 18:09:03',''),(146,'00033-0002',33,2,52,'正式名称で表示','IVCS',NULL,'市場開発（主任～マネージャーレベル）\n\n■マネージャーレベル\n所属部署のスタッフ数：4名\n上司：ベトナム支社総経理、市場部責任者\n部下：3名\n\n■主任レベル\n所属部署のスタッフ数：4名\n上司：ベトナム支社の市場部マネージャー\n\n※労働契約はベトナム法人の「創怡精密（越南）有限公司」と結びます。','契約社員/嘱託社員,アルバイト,正社員','新規顧客開拓及び既存顧客のフォロー\n\n【具体的には】\n■マネージャーレベル\n・チーム売上目標の設定、販売戦略の策定、チーム管理\n・新規顧客の開拓、市場動きの収集、市場アンケート実施\n・プロジェクト推進（立項チャンスの把握、サンプル関連の評価、推進）口座の開設等\n・既存のクライアントとの良好な関係を築き、維持しながら新しいクライアントを開拓する。定期的に訪問する。\n・お客様のニーズ・ニーズに合わせたご提案。\n・販売戦略、販売方法、販売目標を把握する。\n・部署の管理、部下の育成等\n\n■主任レベル\n・新規顧客の開拓、市場動きの収集、市場アンケート実施\n・プロジェクト推進（立項チャンスの把握、サンプル関連の評価、推進）口座の開設等\n・既存のクライアントとの良好な関係を築き、維持しながら新しいクライアントを開拓する。定期的に訪問する。\n・顧客に対する満足度調査\n・顧客の動きに対する調査\n\n■その他\n・顧客訪問などで出張あり\n国内出張（たまにあり）、外出（月に数回）、海外出張（ない）\n・取り扱い商品、サービス：複写機製品（除電ブラシ、ブレード、ローラー）、白物家電製品\n・顧客・クライアント・取引先：キャノン、京セラ、brother、富士ゼロックスなど','ベトナム語ネイティブまたは日本語ネイティブ\n※20～30代が活躍中\n\n＜必要条件＞\n語学：（顧客対応で使用）\n日本語ができるベトナム語ネイティブの方、もしくは、\nベトナム語ビジネスレベル以上の日本語ネイティブの方\nかつ、\n英語ビジネスレベル以上、中国語日本語日常会話レベル以上\n\n＜次のような方のご応募歓迎です＞\n営業経験者or営業職にご興味がある方\nOA機器、電子、機械関連業界にご興味ある方\n性格が明るい方\n\n歓迎するネイティブ言語 = 日本語,ベトナム語\n\n歓迎する求職者属性 = 未経験\n\n勤務開始日 = 応相談','【給与・手当】\nマネージャーレベル：37,500,000～75,000,000VND\n主任レベル：25,500,000～45,000,000VND\nボーナス：年1回（業績による）\nその他：応相談\n\n【福利厚生など】\n海外旅行保険、ビザサポート（日本語ネイティブの方）\n\n【勤務時間・休日】\n勤務時間：9:00～18:00（週6日勤務、8時間制）\n休暇：現地のカレンダー通り\n有給：あり',NULL,'インドネシアジャカルタ','弊社はインドネシアジャカル タで WEB サイトを構築を行っ ております。\nこの度事業拡張にともないス タッフの増強をおこないます。','新卒歓迎,未経験歓迎,シニア歓迎','crzycrzy12@gmail.com','post','2020-11-06 10:37:34',NULL,3,'2020-11-05 19:11