y@gmail.com','post','2020-11-16 20:19:27',NULL,3,'2020-11-16 04:50:56','2021-01-27 18:09:03',''),(213,'00033-0013',33,2,37,'正式名称で表示','IMCA_AS',NULL,'市場開発（主任～マネージャーレベル）\n\n■マネージャーレベル\n所属部署のスタッフ数：4名\n上司：ベトナム支社総経理、市場部責任者',',正社員,契約社員/嘱託社員','大手外資系企業の、日本のお客様に対するカスタマーサポート業務をお任せします。お持ちの英語力によっては外国籍のお客様からのお問い合わせに英語対応して頂く機会もあります！\n\n・日本からのお問い合わせに対してメールや電話でサポート\n・商品を注文したお客様からの配達状況に関する対応\n・配達員や商品を提供するお店からのお問い合わせ対応　など\n\n\n1回の応対にかかる時間は10分程度。1日20〜35件ほどの対応。','WEB ディレクション経験 3 年以上','＜給与手当＞\n月給 :2,000USD（Gross）\n賞与 : 年 2 回\n昇給制度 : 年 1 回あり\n通勤手当 : あり\n通信手当 : あり\n\n＜福利厚生等＞\nビザサポート : あり\n海外旅行保険 : あり\n\n＜就業時間・休日＞\n勤務時間 :9:00 ～ 18:00\n休憩 1 時間\n休日 : 法律に従う\n有休 : 法律に従う','2020年5月以降','ンドネシアジャカルタ','社はインドネシアジャカル タで WEB サイトを構築を行っ ております',',新卒歓迎,シニア歓迎','crzycrzy15@gmail.com','post','2020-11-17 13:31:50',NULL,3,'2020-11-16 22:02:16','2021-01-27 18:09:03',''),(214,'00007-0004',7,2,162,'正式名称で表示','Operations Manager',NULL,'【経験者必見！】環境抜群＊＊グローバル企業でステップアップ\n・Operations Manager','正社員','【業務内容】\n某有名オンラインツアリズムサービスにおいて、電話でのお客様対応をされているチームの管理監督と日々のパフォーマンスをモニタリングをいただきます。\n\n具体的には\n【予算管理・意思決定】\n・運用コストと収益影響を鑑み、必要に応じた適切な意思決定を実施\n・日次KPIを評価し、改善ニーズを探し、運用に落とし込むアイデア検討\n・確立された生産時間と収益目標を達成し、収益機会の損失を最小化\n・要員・スケジュールを管理を行いながら、クライアントと会社の生産性目標達成に導く\n【能力開発・業務改善】\n・サービスデリバリ―スコアカードに基づき運用を管理監督\n・メンバーの能力を認め、それを拡大させる\n・メンバー選定プロセスをハンドル・推進\n・機会を認識し、コミュニケーション・行動することにより、プロセス改善を推進\n・リソースを効果的かつ効率的に管理し、オペレーションを最適化\n【満足度分析・管理】\n・労働効率、サービスレベルのコミットメント、コールあたりコスト目標等のレポート\n・オープンな場で生産性とパフォーマンスの目標を伝え、メンバーのモチベーションを高める\n・関係者と連携を取り、採用、トレーニング、パフォーマンス、従業員関連の問題解決ならびにクライアントの求める品質基準を満たすように努める\n\n【求めるスキル】\n*カスタマーサポートとしてホスピタリティをもってお客様対応ができる方\n*パソコン業務になれている方','【応募必須要件】\n\n・4年制大学卒業後、3年以上のBPOもしくはコールセンターでオペレーションマネジャー経験のある方\n・短大・専門学校卒業の方の場合、社会人経験7年以上の方\n語学：英語力ビジネスレベル以上\n（クライアントも外資系企業になりますので、ビジネスシーンで英語を流暢に話すことができる方）\n\n\n歓迎するネイティブ言語 = 日本語\n\n歓迎する求職者属性 = シニア\n\n勤務開始日 = 2020年11月～勤務開始可能な方。 相談可。','月給：12,000～15,000リンギット\n週休2日制/パフォーマンスによりボーナス支給\n\n【保険制度】\n社会保険／加入条件による ※マレーシアの労基法による\nVISA取得サポート\n入院費負担\nフレックス補助金:最大3,000リンギット／年（病院診察代・書籍代・PC や携帯の購入時に利用可）\n入社特典:マレーシアまでの片道航空券と1